import { queryAllByAltText } from "@testing-library/dom";
import axios from "axios";
import React from "react";
import Image from "./Image";
import { useEffect, useState } from "react";



export default function TableRow({ tableData, tableDisplay, key }) {

  const auth = "GVPDbDdKZe9uvSf5CPNjJ83BuhDEwWxQ6WDT50hiyd8";
  const [pic, setPic] = useState("");

  const api_path = "http://localhost:5000/birds";

  const handleClick = async function handleClick(name) {
     await axios.get(api_path)
     .then(res => setPic(res.data.results)
     
     )
      console.log(pic)
      
    
      // console.log(res[0])
      // .catch((err) => console.log(err));
  };

  const row = function row() {
    return tableData.slice(0, 20).map((el) => (
      <tr onClick={(e) => handleClick(el.comName)} className={el.comName}>
        <td colSpan="1">{el.comName}</td>
        <td colSpan="1">{el.sciName}</td>
        <td>{el.locName}</td>
        <td>{el.obsDt}</td>
      </tr>
    ));
  };

  return (
    <div>
      <thead>
        <tr>
          <th colSpan="1" scope="col">
            Common Name
          </th>
          <th colSpan="1" scope="col" data-label="Scientific Name">
            Scientific Name
          </th>
          <th colSpan="1">Location</th>
          <th colSpan="1">Date</th>
        </tr>
      </thead>
      <tbody>{row()}</tbody>
      <Image pic={pic} />
    </div>
  );
}
